import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";
import styles from "./NavBar.module.css";

const NavBar = (props) => {
  const arrayCheck = () => {
    console.log(props.peopleData.documents);
    props.peopleData.documents.map((element) => {
      return console.log("itworks");
    });
  };

  return (
    <header className={styles.navbar}>
      <nav>
        <ul>
          <li>
            <NavLink
              activeClassName={styles.active}
              to="/pistols"
              onClick={props.arrayCheck}
            >
              Pistols
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName={styles.active} to="/rifles"               onClick={props.arrayCheck}>
              Rifles
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName={styles.active} to="/cannons">
              Cannons
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
